import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Your automation logic here
    // Use a text-based selector to find the cart element, which is more user-centric
    // and different from a simple class-based selector.
    const cartLocator = page.getByText(/Cart/);
    await cartLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Click the cart element to open the modal
    await cartLocator.click();

    // Wait for the modal to become visible. The modal is identified by the '.modal' class.
    // The JS code sets its display to 'block'.
    const modalLocator = page.locator('.modal');
    await modalLocator.waitFor({ state: 'visible', timeout: 5000 });

    // Take a screenshot of the opened modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_modal_open.png'));

    // Extract data to verify the modal content
    const modalTitleLocator = page.locator('.modal h2');
    const modalContentLocator = page.locator('.empty-cart');

    const modalTitle = await modalTitleLocator.textContent();
    const modalContent = await modalContentLocator.textContent();

    return {
      success: true,
      action: "Opened the shopping cart modal",
      extractedData: {
        modalTitle: modalTitle,
        modalContent: modalContent
      },
      screenshots,
      error: null
    };
  } catch (error) {
    // Take a screenshot on failure
    try {
      await page.screenshot({ path: path.join(screenshotsDir, 'error_screenshot.png') });
      // The main screenshots array is not available here, so we don't push to it.
    } catch (screenshotError) {
      console.error('Failed to take error screenshot:', screenshotError);
    }

    return {
      success: false,
      action: "Failed to open the shopping cart modal",
      extractedData: {},
      screenshots: [path.join(screenshotsDir, 'error_screenshot.png')],
      error: error.message
    };
  }
}
